package com.pt.cc;

public class ResultMbtiSet {
	String name;
	String mbti;
	
	public ResultMbtiSet() {
		// TODO Auto-generated constructor stub
	}

	public ResultMbtiSet(String name, String mbti) {
		super();
		this.name = name;
		this.mbti = mbti;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	public String getMbti() {
		return mbti;
	}

	public void setMbti(String mbti) {
		this.mbti = mbti;
	}
	
	
}
